Allow users to provide their own http.Agent when initialising DriverRemoteConnection.

This is extremely helpful connecting to databases within a corporate network.
This is utilising the agent support provided by the [ws library](https://github.com/websockets/ws#how-to-connect-via-a-proxy)

Usage with a SOCKS proxy with [socks-proxy-agent](https://github.com/TooTallNate/proxy-agents/tree/main/packages/socks-proxy-agent):
```js
const { SocksProxyAgent } = require('socks-proxy-agent');
const agent = new SocksProxyAgent(
    'socks://127.0.0.1:1080'
);
const dc = new DriverRemoteConnection('wss://xx:8182/gremlin', { agent });
```
